import Link from 'next/link';

const Index = () => (
  <div>
    <Link href='/history'>
      <a title="History Page">History</a>
    </Link>
    <Link href='/group'>
      <a title="Group Page">Group</a>
    </Link>
    <Link href='/forum'>
      <a title="Forum Page">Forum</a>
    </Link>
    <p>Hello Next.js</p>
  </div>
);

export default Index;
